import hero from "../images/IMG_8070-1-removebg-preview.png"
import hero2 from "../images/image_hero-removebg-preview.png"
function Header() {


    return (
        <>
            <div id="header" className="row">
                <img src={hero2} alt="" className="col align-self-center"/>            
            </div>
            <div className="row justify-content-center">
                <h1 className="col align-self-center">Jonathan Pruitt</h1>
            </div>
        </>
    )
}//end method

export default Header;
